import { ListGroup } from 'react-bootstrap';

export default function Categorias()  {
    return (
        ['sm', 'md', 'lg', 'xl'].map((breakpoint, idx) => (
            <ListGroup horizontal={breakpoint} className="my-2" key={idx}>
                <ListGroup.Item>Mostrar tudo</ListGroup.Item>
                <ListGroup.Item>Geladeiras</ListGroup.Item>
                <ListGroup.Item>Fogões</ListGroup.Item>
                <ListGroup.Item>Micro-ondas</ListGroup.Item>
                <ListGroup.Item>Lavadoras de roupas</ListGroup.Item>
                <ListGroup.Item>Lava-louças</ListGroup.Item>
            </ListGroup>
          ))
    )
}
